import IMAGE_CONSTANTS from './contact.constants'

const INITIAL_STATE = {
    images: IMAGE_CONSTANTS
}

const contactReducer = (state = INITIAL_STATE, action) => {
    switch(action.type) {
        default:
            return state
    }
}

export default contactReducer
